<link rel="stylesheet" href="./css/font-awesome.css">
<style>
body { background:#ffffff; padding:0px; margin:0px; overflow:auto;}
.icon_list {font-size:0;margin:0 0 10px;padding:0;border-width:1px 0 0 1px;}
.icon_list li {list-style:none;width:25px;display:inline-block; padding:5px;
border-width:0 1px 1px 0;border-style:dashed;border-color:#e3e3e3;text-align:center;position:relative;color:#eeeeee}
.icon_list [class*="li_"] {font-size:22px; }
.icon_list [class*="icon-"] {font-size:22px; color:#333333}
.icon_list .icon_use {display:block;font-size:11px;padding:3px 3px 3px 3px;color:#ffffff}
.icon_list li:hover {background:#2DCC70;color:#333333;cursor:pointer}
.panel-body {border-style:dashed;border-color:#e3e3e3;border-width:1px 0 0 1px;
position:relative;margin:auto;width:100%; overflow:auto; min-height:700px!important;}
</style>

<script src="js/icons-js.js"></script>
